import { HttpClient } from "@angular/common/http";
import { Injectable } from "@angular/core";
import { BaseUrl } from "../baseUrl.service";
import { async } from "@angular/core/testing";
import { lastValueFrom } from "rxjs";
import { CompanyDetail } from "src/model/companyDetail.model";

@Injectable()
export class CompanyDetailService{
    base_Url: string = this.url;
constructor(
   private http: HttpClient, 
   private  url: BaseUrl){
}

async findAll(){
    
    return await lastValueFrom(this.http.get(JSON.stringify(this.url) + "company-detail/get"));
}

async create(company: CompanyDetail){
    return await lastValueFrom(this.http.post(this.url + "company-detail/create", company));
}
}
